  <script>

  // Format GeoJSON OL
  var format = new ol.format.GeoJSON();

  // Parcelles
  var featuresParcelles = format.readFeatures(json_Parcellescadastrales, {
    dataProjection: 'EPSG:4326',
    featureProjection: 'EPSG:3857'
  });
  featuresParcelles.forEach(f => {
    let commune = f.get('commune') || '';
    let section = f.get('section') || '';
    let numero = f.get('numero') || '';
    f.set('sect_code', commune + ' ' + section + numero);
  });
  var sourceParcelles = new ol.source.Vector({ features: featuresParcelles });

let zonesIntersectees = []; // déclarée globalement pour export





function verifierIntersections() {
  if (!parcelleSelectionnee) return;

  const parcelleGeoJSON = format.writeFeatureObject(parcelleSelectionnee);

  zonesIntersectees = []; // reset

  // 🔍 Vérification classique pour les couches standard
  function checkSource(source, nomCouche) {
    source.getFeatures().forEach(zone => {
      const zoneGeoJSON = format.writeFeatureObject(zone);
      if (turf.booleanIntersects(parcelleGeoJSON, zoneGeoJSON)) {
	  
	  
	  
	  // 🏛️ Vérification spéciale pour les couches d'urbanisme
        const estCoucheUrbanisme = nomCouche.startsWith('Secteurs') || nomCouche.startsWith('Prescriptions surfaciques');
        
        if (estCoucheUrbanisme) {
          // Pour les couches d'urbanisme, calculer la proportion d'intersection avec la parcelle
          const intersection = turf.intersect(parcelleGeoJSON, zoneGeoJSON);
          
          if (intersection) {
            const aireIntersection = turf.area(intersection);
            const aireParcelle = turf.area(parcelleGeoJSON);
            const proportionCouverture = (aireIntersection / aireParcelle) * 100;
            
            // Seuil de 5% minimum pour retenir la zone d'urbanisme
            if (proportionCouverture < 5) {
              console.log(`Zone d'urbanisme "${nomCouche}" ignorée (${proportionCouverture.toFixed(1)}% de la parcelle)`);
              return;
            }
            
            console.log(`Zone d'urbanisme "${nomCouche}" retenue (${proportionCouverture.toFixed(1)}% de la parcelle)`);
          } else {
            // Pas d'intersection géométrique calculable, on ignore
            return;
          }
        }
	  
	  
	  
               // 🏘️ Vérification spéciale pour les communautés de communes
        const estCommunauteCommunes = nomCouche.includes('CCBrayEawy') || 
                                     nomCouche.includes('CCdeLondinieres') || 
                                     nomCouche.includes('CCdes4Rivires');
        
        let coucheAffichee, nomAffiche;
        
        if (estCommunauteCommunes) {
          // Pour les communautés de communes, afficher "Communauté de Communes : nom de la couche"
          coucheAffichee = 'Communauté de communes';
          // Extraire le nom de la CC depuis le nom de la couche
          if (nomCouche.includes('CCBrayEawy')) {
            nomAffiche = 'Bray-Eawy';
          } else if (nomCouche.includes('CCdeLondinieres')) {
            nomAffiche = 'Londinières';
          } else if (nomCouche.includes('CCdes4Rivires')) {
            nomAffiche = '4 Rivières';
          } else {
            nomAffiche = nomCouche; // fallback
          }
        } else {
          // Pour les autres couches, comportement normal
          coucheAffichee = nomCouche;
          nomAffiche = zone.get('nom') || zone.get('NOM') || zone.get('NOMUSUEL') || zone.get('Dossier') ||
                       zone.get('appelation') || zone.get('alea') || zone.get('NATURE') || zone.get('CLASSE') ||
                       zone.get('nom_ets') || zone.get('nom_site') || zone.get('nomsite') || zone.get('nom_instr') ||
                       zone.get('NOM_ZNIEFF') || zone.get('SITENAME') || zone.get('LIBELLE') || zone.get('USAGE1') ||
                       zone.get('libelle') || 
                       zone.get('id') || zone.get('ID') || 'élément détecté sans précision apportée';
        }
        
        zonesIntersectees.push({
          couche: coucheAffichee,
          nom: nomAffiche
        });
      }
    });
  }
  
  
  
  
  
  

  // 🏘️ Traitement spécial pour les COMMUNES : on choisit celle avec la plus grande aire d’intersection
  let meilleureCommune = null;
  let aireMax = 0;

  featuresCommunes.forEach(communeFeature => {
    const communeGeoJSON = format.writeFeatureObject(communeFeature);

    // Vérifier que les géométries sont valides
    if (
      (parcelleGeoJSON.geometry.type === "Polygon" || parcelleGeoJSON.geometry.type === "MultiPolygon") &&
      (communeGeoJSON.geometry.type === "Polygon" || communeGeoJSON.geometry.type === "MultiPolygon")
    ) {
      const intersection = turf.intersect(parcelleGeoJSON, communeGeoJSON);

      if (intersection) {
        const aire = turf.area(intersection);
        if (aire > aireMax) {
          aireMax = aire;
          meilleureCommune = communeFeature;
        }
      }
    }
  });

  if (meilleureCommune) {
    zonesIntersectees.push({
      couche: 'Commune',
      nom: meilleureCommune.get('nom') || meilleureCommune.get('NOM') || 'Commune non nommée'
    });
  }

const labels = {
  id: 'ID',
  nom: 'Nom',
  commune: 'Code INSEE',
  prefixe: 'Préfixe',
  section: 'Section',
  numero: 'Numéro'
};

for (const key of champsAConserver) {
  const value = parcelleSelectionnee.get(key);
  if (value !== undefined) {
    // Utilise le label personnalisé, ou la clé brute par défaut
    const label = labels[key] || key;
    html += `<li>${label} : ${value}</li>`;
  }
}

html += '</ul><strong>Éléments détectés sur la parcelle :</strong><ul>';

  if (zonesIntersectees.length) {
    zonesIntersectees.forEach(z => {
      html += `<li><b>${z.couche}</b> : ${z.nom}</li>`;
    });
  } else {
    html += '<li>Aucune zone intersectée</li>';
  }
  html += '</ul>';

  document.getElementById('fiche-content').innerHTML = html;

  // Activation du bouton export
  document.getElementById('export-pdf-btn').disabled = false;

function ajouterPiedDePage(doc, pageNum) {
  const pageCount = doc.getNumberOfPages();
  doc.setFontSize(8);
  doc.setTextColor(150);
  doc.text(`Page ${pageNum} / ${pageCount}`, 105, 285, { align: "center" });
  doc.text("Observatoire Territorial de la Transition Écologique et Climatique", 105, 290, { align: "center" });
  
    if (logoBase64) {
    doc.addImage(logoBase64, 'PNG', 37, 278, 22, 14); // x, y, width, height
  }
  if (logoLEADER) {
    doc.addImage(logoLEADER, 'PNG', 7, 278, 26, 15); // x, y, width, height
  }
  if (logoCC4R) {
    doc.addImage(logoCC4R, 'PNG', 167, 278, 22, 15); // x, y, width, height
  }
  if (logoCBE) {
    doc.addImage(logoCBE, 'PNG', 147, 278, 20, 15); // x, y, width, height
  }
  if (logoCCL) {
    doc.addImage(logoCCL, 'PNG', 190, 276, 20, 18); // x, y, width, height
  }
}

function exportToPDF() {
  if (!parcelleSelectionnee) return alert("Aucune parcelle sélectionnée");

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();
  const now = new Date();
  const dateStr = now.toLocaleDateString('fr-FR');
  

  let y = 10;
  doc.setFont("helvetica", "normal");


const idParcelle = parcelleSelectionnee.get('id');

  // Titre
const titre = `Rapport d'analyse de la parcelle ${idParcelle}`;
doc.setFontSize(16);
doc.setFont("helvetica", "bold");
doc.text(titre, 105, 25, { align: "center" });
y = 30;






  // Date
 doc.setFontSize(10);
doc.setFont("helvetica", "normal");
doc.text(`Rapport généré le : ${dateStr}`, 195, 76, { align: "right" });
  
  
  // Heure
  
const maintenant = new Date();
const heures = String(maintenant.getHours()).padStart(2, '0');
const minutes = String(maintenant.getMinutes()).padStart(2, '0');
const secondes = String(maintenant.getSeconds()).padStart(2, '0');
const heureFormatee = `${heures}:${minutes}:${secondes}`;
  doc.text(`à : ${heureFormatee}`, 195, 82, { align: "right" });


<!-- Ligne de séparation -->
doc.setDrawColor(100); // gris foncé
doc.setLineWidth(0.5);
doc.line(10, y + 5, 200, y + 5);

// Définir le style du cadre
doc.setDrawColor(100); // gris foncé
doc.setLineWidth(0.5);


// Dessiner le cadre autour du titre (ex: centré entre x=10 et x=200, hauteur 12)
doc.rect(10, 10, 190, 75); // x, y, largeur, hauteur

y = 50; // Décale le contenu principal après le titre


const labels = {
  id: 'ID',
  commune: 'Commune',
  prefixe: 'Préfixe',
  section: 'Section',
  numero: 'Numéro'
};

// Infos parcelle
doc.setFontSize(12);
 doc.setFont("helvetica", "bold");
doc.text("Désignation de la parcelle :", 12, y, { align: "left" });
y += 8;

const champsAConserver = ['id', 'commune', 'prefixe', 'section', 'numero'];

for (const key of champsAConserver) {
  const value = parcelleSelectionnee.get(key);
  if (value !== undefined) {
    doc.setFontSize(10);
    doc.setFont("helvetica", "normal");

    // Utilise le label personnalisé
    const label = labels[key] || key;
    doc.text(`${label} : ${value}`, 12, y);
    y += 6;
  }
}

y += 12;

  // Résultats
  doc.setFontSize(12);
  doc.setFont("helvetica", "bold");
  doc.text("Éléments détectés sur la parcelle :", 100, y, { align: "center" });
  y += 8;

  if (zonesIntersectees.length) {
    // Grouper par catégorie
    const groupes = {};
    zonesIntersectees.forEach(z => {
      const theme = dictionnaireCategories[z.couche] || "Autres";
      if (!groupes[theme]) groupes[theme] = [];
      groupes[theme].push({
        couche: z.couche,
        nom: z.nom
      });
    });

 

for (const theme in groupes) {
  // Séparateur visuel
  doc.setDrawColor(160);
  doc.setLineWidth(0.3);
  doc.line(10, y, 200, y);
  y += 2;

  // Fond gris clair derrière le titre
  doc.setFillColor(240);
  doc.rect(10, y - 5, 190, 8, 'F');

  // Titre de catégorie
  doc.setFont("helvetica", "bold");
  doc.setFontSize(11);
  doc.setTextColor(0);
  doc.text(`${theme}`, 12, y);
  y += 8;

  groupes[theme].forEach(({ couche, nom }) => {
    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.text(`• ${couche} :`, 12, y);

    
    const offset = doc.getTextWidth(`• ${couche} :`) + 13;

    doc.setFont("helvetica", "normal");

    
    const nomLines = doc.splitTextToSize(nom, 200 - offset);

    for (let i = 0; i < nomLines.length; i++) {
      doc.text(nomLines[i], offset, y);
      y += 5;

      if (y > 260) {
	  // AJOUT DU PIED DE PAGE AVANT DE CRÉER UNE NOUVELLE PAGE
            ajouterPiedDePage;
        doc.addPage();
        y = 13;
      }
    }

    y += 2;
  });

  y += 4;
}

  } else {
    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    doc.text("Aucun élément détecté sur la parcelle.", 10, y);
  }

  // MODIFICATION : Ajouter le pied de page sur toutes les pages
  const totalPages = doc.getNumberOfPages();
  for (let i = 1; i <= totalPages; i++) {
    doc.setPage(i);
    ajouterPiedDePage(doc, i);
  }

  const filename = `fiche_parcelle_${parcelleSelectionnee.get('sect_code') || 'inconnue'}.pdf`;
  doc.save(filename);
}


// Événements
document.getElementById('search-btn').addEventListener('click', () => {
  let code = document.getElementById('search-input').value.trim();
  if (!code) return;
  const parcelle = rechercherParcelle(code);
  afficherParcelle(parcelle);
  document.getElementById('export-pdf-btn').disabled = true; // désactive l'export au nouveau search
});
